import React from 'react';
import {
  FooterContacts,
  FooterNav,
  FooterNavLink,
  FooterNavList,
  FooterNavListItem,
  FooterTitle,
  StyledFooter
} from "./style";

function Footer() {
  return (
    <StyledFooter>
      <FooterContacts>
        <FooterTitle>Contact Us</FooterTitle>
        <FooterNav>
          <FooterNavList>
            <FooterNavListItem>
              <FooterNavLink href="tel:"></FooterNavLink>
            </FooterNavListItem>
          </FooterNavList>
        </FooterNav>
      </FooterContacts>
    </StyledFooter>
  );
}

export default Footer;
